const NavBar = () => {
  return (
    <header>
      <ul>
        <li>
          <a href="http://localhost:3000/home">Home</a>
        </li>
        <li>
          <a href="http://localhost:3000/shop">Shop</a>
        </li>
      </ul>
    </header>
  );
};

export default NavBar;
